    def update_state(self,msg):
        section = np.floor(self.si/53.47).astype(int)*200
        x = [self.x[j] for j in range(section,(section+210) if section < 800 else 1000)]
        y = [self.y[j] for j in range(section,(section+210) if section < 800 else 1000)]
        s = [self.s[j] for j in range(section,(section+210) if section < 800 else 1000)]

        dx=np.array(x)-msg.x
        dy=np.array(y)-msg.y
        dist = [np.linalg.norm([dx[i],dy[i]]) for i in range(len(x))]
        i=np.argmin(dist)

        if x[i]!=x[i+1]:
            recta=(y[i+1]-y[i])/(x[i+1]-x[i])*(msg.x-x[i])+y[i]-msg.y
            signo_d=np.sign(recta)*np.sign(x[i]-x[i+1])
        else:
            signo_d=np.sign(y[i+1]-y[i])*np.sign(msg.x-x[i])

        d_min=np.min(dist)*signo_d

        corrected_yaw = (msg.yaw+np.pi)%(2*np.pi) - np.pi
        theta = np.arctan2(y[(i+5)%len(x)]-y[i],x[(i+5)%len(x)]-x[i])
        phi = corrected_yaw - theta
        phi_corrected = corrected_yaw - theta if np.abs(phi)<2 else (phi-2*np.pi if phi>0 else phi+2*np.pi)

        self.dist = d_min+0.0001
        self.phi = phi_corrected
        self.vx = msg.vx
        self.vy = msg.vy
        self.r = msg.r
        self.si = s[i]
        self.k = 0 if self.si < 18 else (-1/9.125 if self.si < 131 else (1/9.125 if self.si<247 else 0))


        print(self.si, '; ', self.dist)

    def calculate_command(self):
        k_mu = 0.5
        k_phi = 2
        k_r = 8

        r_target = self.vx*self.k

        self.delta = 1.0*math.degrees(np.arctan(self.k*1.535)) - k_mu*(2*(self.dist**3+0*self.dist**5)) - k_phi*self.phi + k_r*(r_target - self.r)

        cmd = Controls()
        cmd.steering = self.delta
        cmd.accelerator = self.pid.accelerator_control(np.sqrt(self.vx**2 + self.vy**2), self.target)
        self.pub_cmd.publish(cmd)
